import './App.css';
import React  from "react";
import { FC, ReactElement } from "react";
import Darkmode_Wrapper from './Wrapper-Elements/Darkmode-Wrapper';
import Header from './Content-Elements/Header'
import {BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";

interface newRoute {
  setTitle: string,
  setReadMore: string,
  setComponenet: JSX.Element
}

interface myJourney {

}

const MyJourney: FC<myJourney> = ({}) : ReactElement => {
  return <div></div>
}

interface myProjects {

}

const MyProjects: FC<myProjects> = ({}) : ReactElement => {
  return <div></div>
}

interface aboutMe {

}

const AboutMe: FC<aboutMe> = ({}) : ReactElement => {
  return <div></div>
}

// A function that wraps the Application (alternate name: AppWrapper)
class App extends React.Component {
  darkMode = false;
  title="Varunan Varathan"
  readMore = "To My Journey"

  setRoute : FC<newRoute> = ({setTitle, setReadMore, setComponenet}) : ReactElement => {
    this.title = setTitle
    this.readMore = setReadMore
    return setComponenet
  }

  render () {
    return (
      <Router>
        <div id="AppWrapper">
          <Darkmode_Wrapper isDarkMode={this.darkMode}>
            <div id="mainContent">
              <Header title={this.title} readMore= {this.readMore} tabs = {[
                {name: "My Journey"},
                {name : "Projects"}, 
                {name: "About Me"}, 
                {name: "GitHub"}
              ]}/>
              <Routes>
                <Route path="/">
                  {this.setRoute({
                    setTitle :  "Varunan Varathan",
                    setReadMore : "To My Journey",
                    setComponenet : <MyJourney />
                  })}
                </Route>
                <Route path="/MyJoureny">
                  {this.setRoute({
                    setTitle :  "Varunan Varathan",
                    setReadMore : "To My Journey",
                    setComponenet : <MyJourney />
                  })}
                </Route>
                <Route path="/MyProjects">
                  {this.setRoute({
                    setTitle :  "MyProjects",
                    setReadMore : "",
                    setComponenet : <MyProjects />
                  })}
                </Route>
                <Route path="/AboutMe">
                  {this.setRoute({
                    setTitle :  "About Me",
                    setReadMore : "",
                    setComponenet : <AboutMe />
                  })}
                </Route>
              </Routes>
            </div>
          </Darkmode_Wrapper>
        </div>
      </Router>
    );
  }
}

export default App;
